# adjust inputs of first conv layer to match changes
model_config['layers'][2]['inbound_nodes'] = [[['rule_50_scale', 0, 0, {}]]]
model_config['input_layers'] = [['input_1', 0, 0]]

# fix 2: The value head output softmax
# find value head output layer and change the activation to softmax
for layer in model_config['layers']:
    if layer['config']['name'] == 'value/dense2':
        layer['config']['activation'] = 'softmax'
        break

# create new model from new config
new_model = model.__class__.from_config(model_config,
                                        custom_objects={"ApplySqueezeExcitation": ApplySqueezeExcitation,
                                                        "ApplyPolicyMap": ApplyPolicyMap,
                                                        "ApplyAttentionPolicyMap": ApplyAttentionPolicyMap})
# fill new model weights
start = 2 if old_code else 1
for old_layer in model.layers[start:]:
    w = old_layer.get_weights()
    if w.__len__() > 0:
        for new_layer in new_model.layers[2:]:
            if old_layer.name == new_layer.name \
                    and old_layer.inbound_nodes[0].layer.name == new_layer.inbound_nodes[0].layer.name:
                new_layer.set_weights(w)
                break


"""EXAMINE NEW MODEL"""
print(new_model.summary())
for i, l in enumerate(new_model.layers):
    print(l.name, l.output_shape)
    if i == 8:
        break


"""SAVE NEW MODEL"""
new_model.save(root + save_path)
